  exports.platforms = ['browser'];
  exports.after = ['startup'];
  exports.before = ['story'];
  exports.synchronous = true;
  exports.startup = () => {
    const tailwindFile = 'tailwindcss.min.js';

    // console.warn()
    // const originalWarn = console.warn;

